<script>
const {autoUpdate} = require('electron-auto-update');
export default {
  data: () => ({
    active: "home",
    barcodeValue: "zeyad",
  }),
  methods: {
    triggerUpdates(){
      
      // Assign the updater to a variable that you can call manually
      // const updater = autoUpdate();

      // // Call at some point later:
      // updater.triggerUpdateCheck();

    },
    printBarCode() {
      const { ipcRenderer } = require("electron");

      ipcRenderer.send("printBarCode");
    },
    logout() {
      this.$store.commit("Logout");
    },
  },
  computed: {
    notAdmin() {
      let user = localStorage.getItem("heavenDashboardUser");
      if (JSON.parse(user).role_id != 1) {
        return true;
      } else {
        return false;
      }
    },
    moshref() {
      let user = localStorage.getItem("heavenDashboardUser");
      if (JSON.parse(user).role_id == 3) {
        return true;
      } else {
        return false;
      }
    },
  },
};
